import React, { Component } from "react";
import { Card, CardTitle } from "reactstrap";

class DishdetailComponent extends Component {
  render() {
    const select = Object.values(this.props.dish);

    return (
      <div>
        <p>{select}</p>
      </div>
    );
  }
}
export default DishdetailComponent;
